import Header from "./Header";
import MyHead from "./MyHead";

const layoutStyle = {
  margin: 20
};

const Layout = props => {
  return (
    <>
      <MyHead page={props.page} />
      <div style={layoutStyle}>
        <Header />
        {props.children}
      </div>
    </>
  );
};

export default Layout;
